        title: "高性能数据访问中间件OBProxy（六）：OBProxy高可用的那些事",
        summary:
          "相比传统的 IOE 架构，OceanBase 利用更低的成本实现了更高的可用性，为客户提供机器级别容灾、机房级别容灾和城市级别容灾特性，是 OceanBase 数据库的杀手锏之一，深受用户喜欢，因此，本文将对高可用特性展开详细的介绍。从技术角度看，分布式系统的高可用涉及的模块很多，每个模块都可能出现故障，实现高可用特性是一件非常困难的事情。即使困难很多，OceanBase 数据库还是对外做了 RPO = 0、RTO < 30s 的承诺，这其中涉及到的知识点很多，OBProxy 遇到的问题和 OBServer 也有很大不同，由于本文是 OBProxy 系列文章，所以主要从 OBProxy 的视角去介绍高可用的内容，但 OBServer 的高可用实现也非常精彩，大家也可以多多了解～",
