        summary:
          " 了解MySQL与OceanBase的差异性与兼容性，携程自研数据库发布系统的实践：金融级分布式关系型数据库OceanBase自开源以来，在携程的线上环境中被广泛使用。而在此前，携程线上环境使用MySQL作为主要业务数据库，在选择新的数据库时，与MySQL的兼容性就成了重要的选型因素之一。因此，为了测试和验证OceanBase与MySQL的兼容性，我们自研了一套数据库发布系统，帮助DBA、业务人员及运维人员快速了解MySQL与OceanBase在DDL语句方面的差异，更好地熟悉和掌握OceanBase数据库，提升应用稳定性。",
