        title: "SQL 改写系列五：视图合并设计与实践",
        summary:
          "为了获得更好的优化结果，OceanBase 会进行 “视图合并”，即在面对连接的对象中有视图，或者内联视图的情况时，我们不去等待视图把结果运行出来再连接，而是把视图中的表、过滤条件及其它子句合并到父查询中。对 Q1 合并之后，三张表将属于同一个查询块，优化器可以更加灵活地调整它们的连接次序。\n\n本文将主要介绍 OceanBase 在视图合并上的一些设计与实践。下文会首先从简单的场景开始，讲解如何改写一个仅包含 SELECT-FROM-WHERE 的视图；之后会拓展到更复杂的场景，最后再讲解如何改写一个带 GROUP-BY 的视图。",
