        summary:
          "虽然“分区”的概念不是很新,但是 ”分区”对理解 OceanBase 的很多原理却是非常重要的。分区是一种水平拆分方案从水平拆分设计上说，目前分布式数据库产品里有三种拆分途径。一是以 Spanner、为代表的在存储层按定长块切片的，称为Region，拆分细节对业务完全透明。二是以 ORACLE、OceanBa分区是一种水平拆分方案，是数据同步的最小单元，是高可用的最小单元，是高可用的最小单元。",
